import React from 'react';
import Expo from './expo.js'
import Ech from './img/expo-2023.jpeg'
import Inmo from './img/inmo-encuentro.jpeg'

function Exposiciones() {
  return (
    <div>
      <h1 className='cabezado'>Página de Exposiciones</h1>
      <p className='cabezado'>Aqui es donde e expuesto.</p>
      <Expo 
       lugar="Galeria Sala Aires De Córdoba"
       fecha="15-Febrero-2023"
       contenido="Participe en la exposicion From me, to you, celebrada entre el 17 de febrero hasta el 14 de marzo, obras confeccionada mediante acrílico sobre lienzo. Feria de Córdoba (32x62 cm), Ramo de Rosas Para Tí (43x53 cm) y Come With Me (67x46 cm)."
       imagen={Ech} />
      <Expo 
        lugar="Galeria Sala Encuentro en Sevilla"
        fecha="Septiembre/Octubre-2022"
        contenido="Exposicion individual de 15 cuadros con tecnica de acrílico sobre lienzos, canvasy cristal."
     imagen={Inmo} />
    </div>
  );
}

export default Exposiciones;
